// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.18;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Base64.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./SVGGen2.sol";
import "hardhat/console.sol";

contract Chainellation is ERC721, ERC721Enumerable, Ownable {
    using Strings for uint256;
    using Counters for Counters.Counter;

    string constant addonABI =
        "function getAddon(uint256 tokenId) view returns (string memory)";

    Counters.Counter private _tokenIds;
    uint256 public maxSupply = 500;
    uint256 public mintCost = 0; // 5 * 10 ** 16;

    mapping(uint256 => SVGGen2.DNA) public dnas;

    mapping(uint256 => uint16) public timeZoneOffset;
    mapping(uint256 => uint16) public gazes;
    mapping(uint256 => uint256) public lastGaze;

    mapping(uint256 => uint256) public lastGust;

    constructor() ERC721("chainellation", "STARS") {}

    function tokenURI(
        uint256 tokenId
    ) public view virtual override returns (string memory) {
        bytes memory dataURI = abi.encodePacked(
            "{",
            '"name": "chainellation #',
            tokenId.toString(),
            '",',
            '"description": "chainellation",',
            '"image": "',
            generateCharacter(tokenId),
            '"',
            "}"
        );
        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    Base64.encode(dataURI)
                )
            );
    }

    // This is awkward because I don't want to deal with negative numbers.
    // if the timezone offset is negative, we're gonna pretend like it's a day in the future
    // this doesn't matter because the timezone offset is only used to determine the time of day
    // and not the actual day.
    function mint(uint16 timezoneOffset) public payable {
        if (msg.value < mintCost) revert Cost();

        _tokenIds.increment();
        if (_tokenIds.current() >= maxSupply) revert MaxSupplyReached();
        uint256 newItemId = _tokenIds.current();
        timeZoneOffset[newItemId] = timezoneOffset;
        _safeMint(msg.sender, newItemId);
        lastGust[newItemId] = systemTime();
    }

    function generateCharacter(
        uint256 tokenId
    ) public view returns (string memory) {
        // uint8 daysSince = uint8(daysSinceLastGust(tokenId));
        // uint16 gazeSub = SVGGen2.subZero(
        //     gazes[tokenId],
        //     (SVGGen2.subZero(daysSince, 6))
        // );

        uint8 daysSince = uint8(daysSinceLastGust(tokenId));
        uint16 gazeSub = gazeSubGusts(tokenId);

        bytes memory svg = abi.encodePacked(
            generateSVG(tokenId, gazeSub, daysSince, !isNight())
        );

        return
            string(
                abi.encodePacked(
                    "data:image/svg+xml;base64,",
                    Base64.encode(svg)
                )
            );
    }

    function generateSVG(
        uint256 tokenId,
        uint256 gazed,
        uint8 cloudsAt,
        bool sunUp
    ) public view returns (string memory) {
        return SVGGen2.generateSVG(genDNA(tokenId), gazed, sunUp, cloudsAt, "");
    }

    function starGaze(uint256 tokenId) public {
        if (ownerOf(tokenId) != msg.sender) revert NotTheOwner();
        if (!isNight()) revert NotNight();
        if (systemTime() - lastGaze[tokenId] < 14 hours)
            revert NotEnoughTimePassed();
        if (daysSinceLastGust(tokenId) > 1) revert TooCloudy();
        gazes[tokenId] = gazes[tokenId]++;
        lastGaze[tokenId] = systemTime();
    }

    function gust(uint256 tokenId) public {
        if (ownerOf(tokenId) != msg.sender) revert NotTheOwner();
        lastGust[tokenId] = systemTime();
    }

    function gazeSubGusts(uint256 tokenId) public view returns (uint16) {
        uint8 daysSince = uint8(daysSinceLastGust(tokenId));
        uint16 gazeSub = SVGGen2.subZero(
            gazes[tokenId],
            (SVGGen2.subZero(daysSince, 6))
        );
        return gazeSub;
    }

    function daysSinceLastGust(uint256 tokenId) public view returns (uint256) {
        return (systemTime() - lastGust[tokenId]) / 1 days;
    }

    function setMaxSupply(uint256 _maxSupply) public onlyOwner {
        maxSupply = _maxSupply;
    }

    function setMintCost(uint256 _newMintCost) public onlyOwner {
        mintCost = _newMintCost;
    }

    function currentSupply() public view returns (uint256) {
        return _tokenIds.current();
    }

    function systemTimeOffsetWithUser(
        uint256 tokenId
    ) public view returns (uint256) {
        return systemTime() + (timeZoneOffset[tokenId]);
    }

    function systemTime() public view virtual returns (uint256) {
        return block.timestamp;
    }

    function isNight() public view returns (bool) {
        uint8 hour = (uint8)((systemTime() / 60 / 60) % 24);
        return hour < 6 || hour > 18;
    }

    function withdraw() external onlyOwner {
        payable(address(_msgSender())).transfer(address(this).balance);
    }

    function withdrawToken(
        address _tokenContract,
        uint256 _amount
    ) external onlyOwner {
        IERC20(_tokenContract).transfer(msg.sender, _amount);
    }

    function genDNA(uint256 tokenId) public view returns (SVGGen2.DNA memory) {
        SVGGen2.DNA memory dna;
        dna.baseColor = uint16((tokenId % 16) * 10);
        dna.starSeed = SVGGen2.psuedorandom(tokenId, 123);
        dna.funkSeed = SVGGen2.psuedorandom(tokenId, 234);
        dna.circleSeed = SVGGen2.psuedorandom(tokenId, 345);
        dna.groundSeed = SVGGen2.psuedorandom(tokenId, 456);
        // console.log("groundSeed: ", dna.groundSeed);
        dna.constellationSeed = tokenId;

        return dna;
    }

    error NotTheOwner();
    error NotEnoughTimePassed();
    error MaxSupplyReached();
    error NotNight();
    error Cost();
    error TooCloudy();

    //------------------------------------------------------ Solidity Overrides
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

interface IERC20 {
    function transfer(address _to, uint256 _amount) external returns (bool);
}

