// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.18;
import "hardhat/console.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

library Color {
    using Strings for uint256;

    struct HSL {
        uint16 H;
        uint16 S;
        uint16 L;
    }

    struct Point {
        uint16 x;
        uint16 y;
    }

    struct Circle {
        uint16 x;
        uint16 y;
        uint16 r;
        uint8 count;
        uint16 stroke;
        bool active;
    }

    function HSLtoString(HSL memory color) public pure returns (string memory) {
        return
            string(
                abi.encodePacked(
                    "hsl(",
                    ((uint256)(color.H)).toString(),
                    ",",
                    ((uint256)(color.S)).toString(),
                    "%,",
                    ((uint256)(color.L)).toString(),
                    "%)"
                )
            );
    }

    function toString(uint16 num) public pure returns (string memory) {
        return ((uint256)(num)).toString();
    }

    function psuedorandom(
        uint256 tokenId,
        uint256 nonce
    ) public pure returns (uint256) {
        return uint(keccak256(abi.encodePacked(tokenId, nonce)));
    }

    function wiggle(
        uint256 tokenId,
        uint256 nonce,
        uint16 base,
        uint16 offset
    ) public pure returns (uint16) {
        uint16 wiggleAmount = (uint16)(psuedorandom(tokenId, nonce) % offset);
        if ((uint8)(psuedorandom(tokenId, nonce) % 2) == 0) {
            return base + wiggleAmount;
        } else {
            return subZero(base, wiggleAmount);
        }
    }

    function wiggleString(
        uint256 tokenId,
        uint256 nonce,
        uint16 base,
        uint16 offset
    ) public pure returns (string memory) {
        return toString(wiggle(tokenId, nonce, base, offset));
    }

    function wiggleTowards(
        uint256 tokenId,
        uint256 nonce,
        uint16 base,
        uint16 offset,
        uint16 end
    ) public pure returns (uint16) {
        if (base > end) {
            return wiggleDown(tokenId, nonce, base, offset);
        } else {
            return wiggleUp(tokenId, nonce, base, offset);
        }
    }

    function wiggleUp(
        uint256 tokenId,
        uint256 nonce,
        uint16 base,
        uint16 offset
    ) public pure returns (uint16) {
        uint16 wiggleAmount = (uint16)(psuedorandom(tokenId, nonce) % offset);
        return base + wiggleAmount;
    }

    function wiggleDown(
        uint256 tokenId,
        uint256 nonce,
        uint16 base,
        uint16 offset
    ) public pure returns (uint16) {
        uint16 wiggleAmount = (uint16)(psuedorandom(tokenId, nonce) % offset);
        return base - wiggleAmount;
    }

    function subZero(uint16 first, uint16 second) public pure returns (uint16) {
        if (first > second) {
            return first - second;
        } else {
            return 0;
        }
    }

    function min(uint16 first, uint16 second) public pure returns (uint16) {
        if (first > second) {
            return first;
        } else {
            return second;
        }
    }

    function mid(uint16 first, uint16 second) public pure returns (uint16) {
        return (first + second) / 2;
    }

    function avg(
        uint16 first,
        uint16 second,
        uint16 count
    ) public pure returns (uint16) {
        return (first + second) / count;
    }

    function stepColorUp(
        Color.HSL memory color,
        uint8 step,
        bool slow
    ) public pure returns (Color.HSL memory) {
        uint16 H;
        if (step < 4 && slow) {
            H = color.H + (step * 2);
        } else {
            H = color.H + (step * 12);
        }
        return
            Color.HSL(H, subZero(color.S, (step * 14)), color.L + (step * 9));
    }

    function stepColorDown(
        Color.HSL memory color,
        uint8 step
    ) public pure returns (Color.HSL memory) {
        return
            Color.HSL(
                color.H,
                color.S + (step * 14),
                subZero(color.L, (step * 9))
            );
    }

    function flipColor(
        Color.HSL memory color
    ) public pure returns (Color.HSL memory) {
        uint16 newH = color.H + 180 > 360 ? color.H - 180 : color.H + 180;
        return Color.HSL(newH, color.S, color.L);
    }

    function rotateColor(
        Color.HSL memory color,
        uint16 amount
    ) public pure returns (Color.HSL memory) {
        uint16 newH = color.H + amount > 360
            ? subZero(color.H, amount)
            : color.H + amount;
        return Color.HSL(newH, color.S, color.L);
    }
}

