// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.18;
import "hardhat/console.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

library Constellations {
    using Strings for uint256;

    function getConstellation(
        uint256 constellationSeed,
        bool fullReveal,
        uint8 gazed
    ) public view returns (string memory, uint8 remaining) {
        uint8 seed = (uint8)(constellationSeed % 13);
        if (seed == 0) {
            return Aries(gazed, fullReveal);
        } else if (seed == 1) {
            return Sagittarius(gazed, fullReveal);
        } else if (seed == 2) {
            return Capricorn(gazed, fullReveal);
        } else if (seed == 3) {
            return Aquarius(gazed, fullReveal);
        } else if (seed == 4) {
            return Pisces(gazed, fullReveal);
        } else if (seed == 5) {
            return Scorpio(gazed, fullReveal);
        } else if (seed == 6) {
            return Libra(gazed, fullReveal);
        } else if (seed == 7) {
            return Virgo(gazed, fullReveal);
        } else if (seed == 8) {
            return Leo(gazed, fullReveal);
        } else if (seed == 9) {
            return Cancer(gazed, fullReveal);
        } else if (seed == 10) {
            return Gemini(gazed, fullReveal);
        } else if (seed == 11) {
            return Taurus(gazed, fullReveal);
        } else if (seed == 12) {
            return Pegasus(gazed, fullReveal);
        } else if (seed == 13) {
            return UrsaMinor(gazed, fullReveal);
        } else {
            return Cygnus(gazed, fullReveal);
        }
    }

    function buildStar(
        string[] memory stars,
        string memory open,
        string memory close,
        uint8 show,
        bool fullReveal
    ) public view returns (string memory, uint8 remaining) {
        if (fullReveal || show > stars.length) {
            show = (uint8)(stars.length);
        }
        uint8 left = show;
        string memory constellation = "";
        constellation = string.concat(constellation, open);
        for (uint8 i = 0; i < show; i++) {
            constellation = string.concat(constellation, stars[i]);
            left--;
        }
        if (show == stars.length) {
            constellation = string.concat(constellation, close);
        } else {
            constellation = string.concat(constellation, "</g>");
        }
        // return (constellation, ((uint8)(stars.length) - show));
        return (constellation, left);
    }

    function Aries(
        uint8 show,
        bool fullReveal
    ) public view returns (string memory, uint8 remaining) {
        string[] memory stars = new string[](6);

        string
            memory open = '<g transform="translate(316,133), rotate(0)" fill="white">';

        stars[0] = '<circle cx="-30" cy="60" r="2"/>';
        stars[1] = '<circle cx="-10" cy="45" r="2"/>';
        stars[2] = '<circle cx="5" cy="0" r="2"/>';
        stars[3] = '<circle cx="55" cy="10" r="2"/>';
        stars[4] = '<circle cx="80" cy="30" r="2"/>';
        stars[5] = '<circle cx="85" cy="45" r="2"/>';

        string
            memory close = '<path d="m -30 60 L -10 45 L 5 0 L 55 10 L 80 30 L 85 45" fill="none" stroke="white" opacity=".5"/></g>';
        return buildStar(stars, open, close, show, fullReveal);
    }

    function Sagittarius(
        uint8 show,
        bool fullReveal
    ) public view returns (string memory, uint8 remaining) {
        string
            memory open = '<g transform="translate(234,-290), rotate(0)" fill="white">';
        string[] memory stars = new string[](20);

        stars[0] = '<circle r="2" cx="169" cy="447"/>';
