// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.18;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

contract UFO is ERC721 {
    using Strings for uint256;
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIds;

    uint256 public maxSupply = 500;
    uint256 public mintCost = 5 * 10 ** 16;

    constructor() ERC721("chainellation UFO", "UFO") {}

    function tokenURI(
        uint256 tokenId
    ) public view virtual override returns (string memory) {
        bytes memory dataURI = abi.encodePacked(
            "{",
            '"name": "chainellation UFO #',
            tokenId.toString(),
            '",',
            '"description": "chainellation UFO",',
            '"image": "',
            generateCharacter(tokenId),
            '"',
            "}"
        );
        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    Base64.encode(dataURI)
                )
            );
    }

    function mint() public payable {
        if (msg.value < mintCost) revert Cost();

        _tokenIds.increment();
        if (_tokenIds.current() >= maxSupply) revert MaxSupplyReached();
        uint256 newItemId = _tokenIds.current();
        _safeMint(msg.sender, newItemId);
    }

    function generateCharacter(
        uint256 tokenId
    ) public view returns (string memory) {
        bytes memory svg = abi.encodePacked(packageAsSVG(tokenId));

        return
            string(
                abi.encodePacked(
                    "data:image/svg+xml;base64,",
                    Base64.encode(svg)
                )
            );
    }

    function getAddon(uint256 tokenId) public view returns (string memory) {
        return
            string.concat(
                "<g>",
                '<circle r="10" cx="256" cy="256" fill="white"/>',
                "</g>"
            );
    }

    function packageAsSVG(uint256 tokenId) public view returns (string memory) {
        return string.concat("<svg>", getAddon(tokenId), "</svg>");
    }

    error Cost();
    error MaxSupplyReached();
}

