        string memory stars = "";
        //determine how many are random and how many are constellation
        uint8 starCount = 0;
        uint8 constellationCount = 0;
        // console.log("build stars, gazes: ", gazes);
        if (gazes >= 30) {
            constellationCount = 30;
            starCount = 25;
        } else {
            while (starCount + constellationCount < gazes) {
                if (
                    Color.psuedorandom(
                        starSeed,
                        starCount + constellationCount
                    ) %
                        5 ==
                    2
                ) {
                    constellationCount++;
                } else {
                    starCount++;
                }
            }
        }
        // console.log("build stars, star: ", starCount);
