                continue;
            }

            lines = string.concat(
                lines,
                '<circle r="',
                Color.toString(circles[i].r),
                '" cx="',
                Color.toString(circles[i].x),
                '" cy="',
                Color.toString(circles[i].y),
                '"  stroke-width="1',
                // Color.toString(Color.wiggleUp(tokenId, 123, 1, 4)),
                '"/>'
            );
        }

        for (uint8 i = 0; i < 8; i++) {
            if (circles[i].count == 1) {
                lines = string.concat(
                    lines,
                    '<path d="M ',
                    Color.toString(circles[i].x),
                    ", ",
                    Color.toString(circles[i].y + circles[i].r),
                    ' v 512" stroke="white" stroke-width="1',
                    // Color.toString(circles[i].stroke),
                    '"/>'
                );
            } else if (circles[i].count == 2) {
                if (i % 2 != 0) {
                    continue;
                }

                lines = string.concat(
                    lines,
                    '<path d="M ',
                    Color.toString(circles[i].x),
                    ", ",
                    Color.toString(circles[i].y + circles[i].r),
                    " L ",
                    Color.toString(circles[i].x),
                    " ",
                    Color.toString(circles[i + 1].y - circles[i + 1].r),
                    '" stroke="white" stroke-width="1',
                    // Color.toString(circles[i].stroke),
                    '"/>'
                );
            }
        }

        return lines;
    }

    function psuedorandom(
